{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/camberlyhernandez/google-analytics-capstone-cyclistic-bike-share?scriptVersionId=104186602\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"521ddca5","metadata":{"papermill":{"duration":0.01328,"end_time":"2022-08-25T14:23:08.751232","exception":false,"start_time":"2022-08-25T14:23:08.737952","status":"completed"},"tags":[]},"source":["# **Google Analytics Capstone Project: Case Study 1- Cyclistic Bike-sharing**\n","by Camberly Hernandez\n","Date: 2022-07-29\n"]},{"cell_type":"markdown","id":"89c301d3","metadata":{"papermill":{"duration":0.011388,"end_time":"2022-08-25T14:23:08.774146","exception":false,"start_time":"2022-08-25T14:23:08.762758","status":"completed"},"tags":[]},"source":["This is project is part of the Google Data Analytics Certificate. Here is the comprehensive Analysis I made.\n","\n","Analysis was based on 6 phases taught in the program: **Ask, Prepare, Process, Analyse, Act, Share.**"]},{"cell_type":"markdown","id":"76c66eed","metadata":{"papermill":{"duration":0.011334,"end_time":"2022-08-25T14:23:08.796694","exception":false,"start_time":"2022-08-25T14:23:08.78536","status":"completed"},"tags":[]},"source":["## 1.0 Phase 1: Ask.\n","\n","### 1.1 Background\n","\n","Cyclistic is a bike-share company with around 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. Cyclistic sets itself\n","apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with\n","disabilities and riders who can’t use a standard two-wheeled bike. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","\n","Lilia Moreno, their director of marketing, believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a very good chance to convert casual riders into members.\n","\n","### 1.2 Deliverables: \n","\n","1. A clear statement of the business task \n","guide Cyclistic marketing strategy. \n","2. A description of all data sources used \n","3. Documentation of any cleaning or manipulation of data \n","4. A summary of your analysis \n","5. Supporting visualizations and key findings 6. Your top three recommendations based on your analysis\n","\n","\n","### 1.3 Key tasks\n","\n","##### **1.  Business task **\n","\n","\t1- Analyse the data from the past 12 months (01-06-2021 to 01- 06-2022) to determine the difference in riding behavior between members and casual riders. \n","\t2- Trying to determine if the data provide any other insight.\n","\t\n","###### **2.  Key stakeholders**\n","\n","**Lilia Moreno**-> The marketing director will adjust their marketing campaign based on my finding. \n","**Cyclistic executive team**->  They will decide whether to approve my suggestions or not.\n","**Cyclistic marketing analytics team*** ->: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps \n"," \n","\n","### 1.4 Guiding questions \n","\n","● What is the problem you are trying to solve? \n","\n","I am trying to identify casual riders' behavior to determine the best marketing strategy to convert them into Cyclistic members.\n","\n","● How can your insights drive business decisions?\n","\n","It will determine the type of marketing campaign to launch the next year.  \n","\n","## 2.0 Phase 2: Prepare\n","\n","#### 2.1 Guiding questions\n","\n","● Where is your data located?\n","\n","The data is kept in a public database and it can be found [here](https://divvy-tripdata.s3.amazonaws.com/index.html).\n","\n","● How is the data organized?\n","The data is organized by month. The data used for this analysis goes from 2021-06-01 to 2022-06-01. The data came in the format of 12 CSV files. \n","\n","● Are there issues with bias or credibility in this data? Does your data ROCCC?\n","\n"," **Reliable** -  Because the data set is very large around 6 million rows, it can be considered reliable.  \n","**Original** - The data might not be original since it was collected by a third party. \n","**Comprehensive** -The data contained extra information that allowed a more complete analysis, however, it had a couple of blank rows, especially for station names accounting for about 14% of missing names. \n","**Current** -the data used in this analysis was from the past year which is very up-to-date. \n","**Cited**- This is somewhat unclear since the data is collected from a third party.\n","\n","● How are you addressing licensing, privacy, security, and accessibility?\n","\n"," The data is secure since the identity of customers was kept anonymous when collecting the customer activity on Cyclistic.  \n","The data is provided by Motivate International Inc. under the following privacy [agreement](https://ride.divvybikes.com/data-license-agreement)\n","\n","## 3.0 Phase 3: Process\n","\n","For this analysis, the process, analysis, and visualization were all done in R. \n","\n","### 3.1 Loading and Packages used\n","In this analysis, a handfull of Packages was used and listed below. \n","\n"]},{"cell_type":"code","execution_count":1,"id":"fb258011","metadata":{"execution":{"iopub.execute_input":"2022-08-25T14:23:08.825649Z","iopub.status.busy":"2022-08-25T14:23:08.823572Z","iopub.status.idle":"2022-08-25T14:23:13.189634Z","shell.execute_reply":"2022-08-25T14:23:13.18775Z"},"papermill":{"duration":4.38404,"end_time":"2022-08-25T14:23:13.192019","exception":false,"start_time":"2022-08-25T14:23:08.807979","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u