","write.csv(top_20_to_plot, \"top_20_to_plot.csv\" , row.names = FALSE)\n","write.csv(top_20_casual_venues, \"top_20_casual_venues.csv\" , row.names = FALSE)\n","write.csv(top_20_member_venues, \"top_20_member_venues.csv\" , row.names = FALSE)"]},{"cell_type":"markdown","id":"136dcc36","metadata":{"papermill":{"duration":0.058999,"end_time":"2022-08-25T14:31:29.208404","exception":false,"start_time":"2022-08-25T14:31:29.149405","status":"completed"},"tags":[]},"source":["## 6.0 Phase 6: Act. \n","\n","When trying to identify behavioral differences between cyclistic users the data suggest the following:\n","\n","1) Based on the hour of the day, Casual users seem to have increased usage of Cyclistic bikes between 3 to 7 suggesting that they might be using the service for leisure or commuting back from work. \n","\n","2) When the data was analyzed by day of the week, it is clear that casual users are the prominent users during the weekends. \n","\n","3) More casual riders than members use cyclistic during the summer months, which could suggest usage by tourists as well. \n","\n","4) The average trip duration for casual users is far higher than that of members. This behavior is particularly seen in the \"docked bike\" type.\n","\n","5) The most frequently used starting station by casual users was Streeter Dr. & Grand Ave, which is located near the entertaining district. Other popular starting stations includes areas for leisure and tourism, suggesting that part of the casual riders might be a tourist. \n","\n","### 6.2 Recommendations\n","\n","1) One of the main differences between the behavior between casual users and annual members was the average trip duration. Because the trip duration was so much higher for casual members, maybe Cyclistic could implement a new system where casual members are **charged by trip duration**. \n","\n","2) Because casual riders are more likely to ride during the weekend, **creating a \"Weekend pass\"** that would cover rides starting  Friday, Saturday, and Sunday.\n","\n","3) The data also suggest that \"Docked bike\" types are not accessible to annual members. This might actually be a disadvantage for annual members since casual users have access to the 3 bike types. Maybe **granting access to \"Docked bike\" to annual users** might make the membership more attractive to casual users. \n","\n","4) Focus advertisement in the top 10 locations where casual users start their ride: Streeter Dr & Grand Ave, Millennium Park, Michigan Ave & Oak St, DuSable Lake Shore Dr & Monroe St, Shedd Aquarium,  Theater on the Lake, Wells St & Concord Ln, DuSable Lake Shore, Dr & North Blvd, Clark St & Lincoln Ave, and  Wells St & Elm St.  \n"]},{"cell_type":"markdown","id":"163437ef","metadata":{"papermill":{"duration":0.058706,"end_time":"2022-08-25T14:31:29.325981","exception":false,"start_time":"2022-08-25T14:31:29.267275","status":"completed"},"tags":[]},"source":["Thank you and I hope this was helpful. "]},{"cell_type":"markdown","id":"153af2d4","metadata":{"papermill":{"duration":0.058559,"end_time":"2022-08-25T14:31:29.442952","exception":false,"start_time":"2022-08-25T14:31:29.384393","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"590438db","metadata":{"papermill":{"duration":0.058596,"end_time":"2022-08-25T14:31:29.559992","exception":false,"start_time":"2022-08-25T14:31:29.501396","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"34f302de","metadata":{"papermill":{"duration":0.059044,"end_time":"2022-08-25T14:31:29.678535","exception":false,"start_time":"2022-08-25T14:31:29.619491","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"171ede42","metadata":{"papermill":{"duration":0.059644,"end_time":"2022-08-25T14:31:29.797657","exception":false,"start_time":"2022-08-25T14:31:29.738013","status":"completed"},"tags":[]},"source":[]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirr